import React from "react";
import PropTypes from "prop-types";
import {Router,Link } from "react-router-dom";
import styles from "./styles.module.scss";

const Main = (props, context) => (
  <div className={styles.main}>
      <div className={styles.content}>
        <div className={styles.title}>
          매매요약
        </div>
        <div className={styles.boxs}>
          <div className={styles.box}>
          <div className={styles.boxtitle}>총 거래 횟수</div>
            {!props.loading&&
            (
              <div className={styles.proptitle}>
              <>{props.summary.trade_cnt}</>
              <span>번</span>
              </div>
            )
            }
          </div>
          <div className={styles.box}>
          <div className={styles.boxtitle}>총 거래 손익</div>
          {!props.loading&&
          (
            <div className={styles.proptitle}>
              <>{ parseInt(props.summary.trade_sonik)}</>
              <span>원</span>
              </div>
           
          )
          }
          </div>
          <div className={styles.box}>
          <div className={styles.boxtitle}>총 거래 수수료</div>
          {!props.loading&&
          (
            <div className={styles.proptitle}>
              <>{ parseInt( props.summary.trade_fee)}</>
              <span>원</span>
              </div>
           
          )
          }
          </div>
          <div className={styles.box}>
          <div className={styles.boxtitle}>거래 시작일</div>
          {!props.loading&&
          (
          <div className={styles.proptitle}>
            <>{
              props.summary.first_event_at.split('T')[0]}</>
            </div>
          )
          }
          </div>
        </div>
        
      </div>
  </div>
  
);

Main.propTypes = {
  loading:PropTypes.bool.isRequired,
  summary : PropTypes.object.isRequired,
  onKeyPress:PropTypes.func.isRequired,
  onClick:PropTypes.func.isRequired
};

export default Main;
